export const base = {
    baseUrl: 'http://localhost:8080/',
};

export const supplierApi = {
    baseUrl: 'api/v1/supplier/',
    allSuppliers: 'all',
    supplierIdNameList: 'supplier_id_name',
};

export const customerApi = {
    baseUrl: 'api/v1/customer/',
    allCustomers: 'all',
    customerIdNameList: 'customer_id_name',
};

export const itemApi = {
    baseUrl: 'api/v1/item/',
    allitems: 'all',
    itemIdNameList: 'item_id_name',
    itemIdQtyList: 'item_id_qty',
};

export const stockApi = {
    baseUrl: 'api/v1/stock/',
    allstocks: 'all/',
};

export const orderApi = {
    baseUrl: 'api/v1/invoice/',
    allInvoices: 'all',
};

export const userApi = {
    baseUrl: 'api/v1/user/',
    allUsers: 'all',
};
